Het bureaupersoneel was samengesteld uit: 


de beide secretarissen Mr. Hugo van Bleyswijk en Mr. Jan Abraham Thilenus, ingevolge resolutie van 28 Augustus 1751 met behoud van hun functie naar de nieuwe Kamer overgegaan, zonder opnieuw te zijn beëedigd. De derde secretaris Mr. Jeremias de Swart Steenis werd als secretaris toegevoegd aan van Bleyswijk, die, thans 77 jaar oud, naar eigen verklaring zijn ambt niet meer naar behooren kon waarnemen.Bij Statenresolutie van 22 Juli 1752 werd hij tevens als opvolger van Van Bleyswijk aangewezen, ingeval deze mocht heengaan;

de drie ordinaris-klerken Thomas van Schaak, Mr. Johannes Adrianus Baartmans en Paulus van Ercom. Zij waren ingevolge dezelfde Statenresolutie en die van Gecommitteerde Raden van 1 Mei en 27 Juli 1752 met de secretarissen als hulp van het nieuwe college overgegaan, terwijl de klerk Jacob Verstege ter voldoening aan de resolutie van Holland van 22 Juli 1752 op rapport van Gecommitteerde Raden den 1en September 1752 door de Gecommitteerden ter rekening was benoemd op een wedde overeenkomstig art. 28 van de instructie voor de secretarissen, evenals de klerken J. Aansorgh, W. van Schaeck, A. Bogaert, G. van Houwelinge en A. Husson, die den 6en September 1752 den vereischten eed aflegden en tevens de beide ambtgelden, elk groot f 1000.-, voldeden.

Aan de series rekeningen der administratieve colleges van Holland, waarvan de contrôle bij de oude Kamer ter Auditie en haar opvolgers berustte, was daarmee een einde gekomen en Van der Goes achtte zich gelukkig met zijn ontslag. Toch is het tenslotte merkwaardig na de officieele belichting der feiten de subjectieve beoordeeling der regeeringsdaden betreffende zijn ambt van hemzelven te vernemen, zooals hij die weergaf in het hiervoor bedoeld schrijven aan den Intendant generaal van 29 April 1811. 

(In: Bijlagen Financie 1811 no. 3354.
							 Hij brengt daarbij in herinnering, dat, toen hij "bij dissolutie van de Departementale Rekenkamer van Holland ingevolge staatsbesluit in dato 4 October 1805 op voordragt van den Raad van Financie in dat departement onder derselver toezigt en medewerking met adsistentie der geëmployeerdens en kamerbewaarder tot Commissaris ter afdoening der zaken van voornoemde Rekenkamer wierd aangesteld, den gemelde Raad bij dat besluit tevens was geauthoriseert eene commissie te benoemen, om eenmaal des weeks de werkzaamheden, zoo aan mij als aan de geëmployeerden opgedragen, nauwkeurig na te gaan; voorts om in alle voorkomende gevallen na gelang van zaken te beslissen en voor de meest geregelde en bespoedigende afdoening, welke op ultimo December 1807 was bepaald, sorge te dragen. Dat het ook onder die bepaalde voorwaarde is geweest, dat ik die commissie in soodanig uitgebreid vak van verschillende werkzaamheden, welke alle met de meeste oplettendheid en ter afdoening moesten behandeld worden, niet dan na vele opkomende bedenkingen, te dier tijd aan Commissarissen uit den Raad van Financie voorgedragen, hebbe aanvaard. Dat voorts op den 19en December van den jare 1807 door den landdrost van Maasland aan mij werd gecommuniceerd, dat (ik) bij Koninklijk Besluit van den 4en bevorens voor den tijd van een half jaar, en dus tot den 30en Juny 1808 in de functie als commissaris was gecontinueerd, wanneer ook op den 14en daar te voren door mij aan den Heer Landdrost voornoemt een uitgebreid rapport en verslag nopens de finale afdoening wierd ingezonden. Dat daarna ik op den 29en November van dat jaar door U Hoogedelgestrenge bij eene voor mij zeer vereerende missive - Generaal Secretariaat 1e Bureau no. 37 - onder approbatie van het gemelde rapport, door mij aan den Landdrost gedaan, wierd geïnformeerd, dat Zijne Majesteit U Hoogedelgestrenge had geauthoriseerd, om mij te verzoeken en te committeeren van mij bij voortduring te willen belasten met de nog van tijd tot tijd gevorderd wordende werkzaamheden te termineren en waaraan ik blijkens het algemeen overzigt bij de missive in dato 21e van Grasmaand 1809 overgelegd, zo veel eenigsints konde gereekend worden tot de comptabiliteit te behoren, vermeene te hebben voldaan. Dat door de benoeming van den Landdrost de Commissie van toezigt en medewerking uit den Raad van Financiën was gedissolveerd; de geëmployeerdens aan mij toegevoegd waren voor het grootste gedeelte met het werk der successie bezig, voorders met 1 Mei 1809 vertrokken dezelve na de hoofdstad en alzo bleven de nog van tijd tot tijd gevorderde werkzaamheden, dewelke voor en na de dissolutie der Rekenkamer alleen uit gebrek aan behoorlijke liquidatie en ten eene maal buiten mijn toedoen onafgedaan waren gebleven, alleen ten mijne lasten 

Van der Goes overdrijft hier in niet geringe mate. Uit de in dit schrijven aangevraagde en ook elders vermelde som aan uitkeeringen blijkt het aandeel aan zijn arbeid van de drie hiervoor genoende personen.
							, hetwelk ik met alle discretie vermeene te mogen veronderstellen, dat bij mijne aanstelling tot commissaris de intentie van U Hoogedelgestrenge of van het Staatsbewind niet kan zijn geweest. En het is na alvorens over deeze uitweiding verschooning te hebben gevraagd, dat ik de vrijheid neeme aan U Hoogedelgestrenge bij deeze met gepaste vrijmoedigheid te verzoeken om nu ook aan mij eene behoorlijke décharge van de gepresteerde werkzaamheden, zoo bij de in deeze gemelde besluiten als speciaal bij dat in dato 18 December j.l. aan mij opgedragen geweest, te willen verleenen, en eene ordonnantie der bepaalde somme ter belooning tot verdeeling, als mede van de door mee volgens de nevensgaande notitie benoodigde uitgaven en gedane voorschotten te laten opmaken en aan mij te doen toekomen. Aan den Heer Heyting, aan wie ik alle mogelijke ouvertures, tot de ontbrekende bescheiden betrekking hebbende, reeds heb medegedeeld en aan wie na bekomen approbatie van het nevens gaande rapport het gansche archief der gewezen Hollandsche Rekenkamer ingevolge U Hoogedelgestr. Besluit van 31 January j.l. - Generaal secretariaat no. 58 - moet worden overgegeeven, zal ik bereydvaardig alle die inligtingen, waartoe ik mij in staat bevinde en welke tot afdoening zijner Commissie bevorderlijk kunnen zijn, opgeven. Gelijk ik mede de rekening van den gewezen ontvanger Stoop over 1806, waarvan sedert de door mij ingevolge U Hoogedelgestr. Besluit in dato 19 Maart j.l. gedane aanschrijving aan de heer J. W. Moree geen berigt heb ontvangen, nadat dezelve zal ingekomen zijn, op denzelfden voet als de andere rekeningen van de oude kantoren opnemen, sluiten en het sloth aan den Heer Commissaris Heyting opgeven". De nog resteerende rekeningen werden afgehoord achtereenvolgens door: 


J. H. de Lange en G. J. Loncq, commissarissen bij het Landdrostambt Maasland, of naar het heette door den Landdrost;

J. H. de Lange, Raad ter Prefecture du Dept. des Bouches de la Meuse, of naar het heette door den prefect;

het Hof van Rekeningen;

de commissie, vervangende het Hof van Rekeningen en ten slotte door de Alg. Rekenkamer.

